    return (
        <div className='list-item'>
            <div className="list-item-input-wrapper">
                <div>
                    <h4>{props.name.text}</h4>
                </div>
            </div>

            <div className="item-remove" onClick={() => props.handleNameRemove(props.name.id)}>
                &#x02A2F;
      </div>
        </div>
    )
}

export default ListItem
